import React from "react";
import { Nav } from 'react-bootstrap';
import Logo from './barrioviajero.png';
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";


class Navbar extends React.Component {
  render() {
    return (
      <React.Fragment>
        <Router></Router>
        <Nav variant="tabs" defaultActiveKey="/home" className="justify-content-center h6 p-3 ">
          <Nav.Item>
            <img src={Logo}/>
          </Nav.Item>
          <Nav.Item >
            <Nav.Link eventKey="link-1" className="text-success" id="nav1">Estudios</Nav.Link>
          </Nav.Item>
          <Nav.Item>
            <Nav.Link eventKey="link-1" className="text-success">Skills</Nav.Link>
          </Nav.Item>
          <Nav.Item>
            <Nav.Link eventKey="link-1" className="text-success">Proyectos</Nav.Link>
          </Nav.Item>
          <Nav.Item>
            <Nav.Link eventKey="link-1" className="text-success">Experiencia </Nav.Link>
          </Nav.Item>
        </Nav>
      </React.Fragment>
    );
  }
}

export default Navbar;
